  input: TEXT,F3XA,,"This is an addendum to the amendment previously filed on April
    10, 2006 in order to further clarify the added expenditures and disbursement made
    on my September monthly report.  The additional disbursements and receipts shown
    on the amended report are due to a miscommunication during the transition of Comptrollers.  Specifically,
    how to properly import and disclose expenses that were paid on a split.  Kimberly
    did not clearly understand that she had to take further steps after she imported
    the information into her FEC file software in order to properly show the non federal
    portion of the disbursements and the receipts paid by the non federal account.  As
    soon as Kimberly was made aware of the omission she immediately corrected any
    reports that did not properly disclose allocable expenses. All reports going forward
    will correctly disclose allocable expenses.  The additional disbursements and
    receipts did not adjust the Cash on Hand balance as it was the regular practice
    of the IDP to exactly match the non-federal portion of expenditures on a regular
    basis  (5/12/06 ltr) the catering expenses were for meetings  none of these expenditures
    were made on behalf of a specifically identified candidate and  no funds collected
    at this meeting. The VAN  were not payments for generic drive activities, but
    monthly service payments. "
